// src/components/CarModal.jsx
import React from 'react';
import { FaChevronLeft, FaChevronRight, FaCar } from 'react-icons/fa';

const CarModal = ({ selectedCar, setSelectedCar, currentImageIndex, setCurrentImageIndex, getCarImages, handlePreOrder, getApplicablePromotion, aplicarDesconto }) => {
  const nextImage = () => {
    setCurrentImageIndex((prev) => (prev + 1) % getCarImages(selectedCar?.id).length);
  };

  const prevImage = () => {
    setCurrentImageIndex((prev) => (prev - 1 + getCarImages(selectedCar?.id).length) % getCarImages(selectedCar?.id).length);
  };

  const promotion = getApplicablePromotion(selectedCar);
  const { discountedPrice, discount } = aplicarDesconto(selectedCar.preco, promotion);

  return (
    <div className="modal-overlay">
      <div className="modal-content car-modal">
        <div className="car-gallery">
          <button className="gallery-nav prev" onClick={prevImage}>
            <FaChevronLeft />
          </button>
          {getCarImages(selectedCar.id).length > 0 ? (
            <img
              src={getCarImages(selectedCar.id)[currentImageIndex]}
              alt={`${selectedCar.marca} ${selectedCar.modelo}`}
              className="car-gallery-image"
            />
          ) : (
            <div className="car-gallery-placeholder">
              <FaCar size={40} />
              <p>Nenhuma imagem disponível</p>
            </div>
          )}
          <button className="gallery-nav next" onClick={nextImage}>
            <FaChevronRight />
          </button>
          <div className="gallery-dots">
            {getCarImages(selectedCar.id).map((_, index) => (
              <span
                key={index}
                className={`dot ${index === currentImageIndex ? 'active' : ''}`}
                onClick={() => setCurrentImageIndex(index)}
              />
            ))}
          </div>
        </div>
        <div className="car-details">
          <h2>{selectedCar.marca} {selectedCar.modelo}</h2>
          {promotion && (
            <div className="promotion-title-modal">
              <span>{promotion.titulo}</span>
            </div>
          )}
          <div className="car-specs">
            <p><strong>Ano:</strong> {selectedCar.ano}</p>
            {promotion ? (
              <>
                <p><strong>Preço Original:</strong> R$ {selectedCar.preco.toLocaleString('pt-BR')}</p>
                <p><strong>Desconto:</strong> {promotion.desconto_tipo === 'percentual'
                  ? `${promotion.desconto_valor}%`
                  : `R$ ${promotion.desconto_valor.toLocaleString('pt-BR')}`}</p>
                <p><strong>Preço Final:</strong> R$ {discountedPrice.toLocaleString('pt-BR')}</p>
              </>
            ) : (
              <p><strong>Preço:</strong> R$ {selectedCar.preco.toLocaleString('pt-BR')}</p>
            )}
            <p><strong>Combustível:</strong> {selectedCar.combustivel}</p>
            <p><strong>Quilometragem:</strong> {selectedCar.quilometragem} km</p>
          </div>
          <div className="modal-actions">
            <button
              className="btn btn-primary"
              onClick={() => handlePreOrder(selectedCar.id)}
            >
              Fazer Pré-reserva
            </button>
            <button
              className="btn btn-secondary"
              onClick={() => setSelectedCar(null)}
            >
              Fechar
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CarModal;
